using Microsoft.WindowsAzure.Mobile.Service;
using System;
using System.Data.Entity;
using System.Data.Entity.Spatial;
using System.Web.Http;

namespace NerdstrapSoftware.CheckInCheckOut.Service
{
    public static class WebApiConfig
    {
        public static void Register()
        {
            // Use this class to set configuration options for your mobile service
            ConfigOptions options = new ConfigOptions();

            // Use this class to set WebAPI configuration options
            HttpConfiguration config = ServiceConfig.Initialize(new ConfigBuilder(options));

            AutoMapper.Mapper.Initialize(cfg =>
            {
                cfg.CreateMap<Models.Identity, Contracts.Identity>()
                ;

                cfg.CreateMap<Models.Locus, Contracts.Locus>()
                .ForMember(destinationMember => destinationMember.Latitude, memberOptions => memberOptions.MapFrom(sourceMember => sourceMember.Position != null ? sourceMember.Position.Latitude.ToString() : ""))
                .ForMember(destinationMember => destinationMember.Longitude, memberOptions => memberOptions.MapFrom(sourceMember => sourceMember.Position != null ? sourceMember.Position.Longitude.ToString() : ""))
                ;

                cfg.CreateMap<Models.EntryLog, Contracts.EntryLog>()
                .ForMember(destinationMember => destinationMember.LocusId, memberOptions => memberOptions.MapFrom(sourceMember => sourceMember.Locus.Id))
                .ForSourceMember(sourceMember => sourceMember.Locus, memberOptions => memberOptions.Ignore())
                .ForMember(destinationMember => destinationMember.IdentityId, memberOptions => memberOptions.MapFrom(sourceMember => sourceMember.Identity.Id))
                .ForSourceMember(sourceMember => sourceMember.Identity, memberOptions => memberOptions.Ignore())
                .ForMember(destinationMember => destinationMember.Latitude, memberOptions => memberOptions.MapFrom(sourceMember => sourceMember.Position != null ? sourceMember.Position.Latitude.ToString() : ""))
                .ForMember(destinationMember => destinationMember.Longitude, memberOptions => memberOptions.MapFrom(sourceMember => sourceMember.Position != null ? sourceMember.Position.Longitude.ToString() : ""))
                .ForMember(destinationMember => destinationMember.HasHazard, memberOptions => memberOptions.MapFrom(sourceMember => sourceMember.Locus.HasHazard))
                ;

                cfg.CreateMap<Contracts.CheckInRequest, Models.EntryLog>()
                ;
            });

            // To display errors in the browser during development, uncomment the following
            // line. Comment it out again when you deploy your service for production use.
            config.IncludeErrorDetailPolicy = IncludeErrorDetailPolicy.Always;

            Database.SetInitializer(new MobileServiceInitializer());
        }
    }

